import React from "react";
import { jsPDF } from "jspdf";
import { Download } from "lucide-react";

export const PDFReport = ({ score, questions, responses, userData }) => {
  const generatePDF = () => {
    const doc = new jsPDF();
    let y = 20;
    const lineHeight = 10;
    const margin = 20;
    const pageWidth = doc.internal.pageSize.width;

    // Base64 string for logo.png (replace with your actual base64 string)
    const logoBase64 =
      "data:image/png;base64,"; // Add your base64 string here

    // Add Logo in Top-Right Corner
    const logoWidth = 30; // Width of the logo in the PDF
    const logoHeight = 30; // Height of the logo (adjust based on aspect ratio)
    const logoX = pageWidth - logoWidth - margin; // Position from the right
    const logoY = margin; // Position from the top
    try {
      doc.addImage(logoBase64, "PNG", logoX, logoY, logoWidth, logoHeight);
    } catch (error) {
      console.error("Error adding logo to PDF:", error);
      // Fallback if the base64 string is invalid
      doc.setFontSize(10);
      doc.text("Logo unavailable", logoX, logoY + 5);
    }

    // Title
    doc.setFontSize(20);
    doc.text("JEE Advanced Test Report", pageWidth / 2, y, { align: "center" });
    y += lineHeight * 2;

    // Calculate Overall Percentage Accuracy
    const overallAccuracy = ((score.total / score.maxTotal) * 100).toFixed(2);

    // Overall Score and Accuracy
    doc.setFontSize(16);
    doc.text(`Total Score: ${score.total}/${score.maxTotal}`, margin, y);
    y += lineHeight;
    doc.text(`Overall Accuracy: ${overallAccuracy}%`, margin, y);
    y += lineHeight * 2;

    // Section-wise Scores and Accuracy
    doc.setFontSize(14);
    Object.entries(score.sectionWise).forEach(([section, sectionScore]) => {
      // Calculate Section-wise Percentage Accuracy
      const sectionAccuracy = (
        (sectionScore.total / sectionScore.maxTotal) *
        100
      ).toFixed(2);

      doc.text(
        `${section}: ${sectionScore.total}/${sectionScore.maxTotal}`,
        margin,
        y
      );
      y += lineHeight;
      doc.text(`Accuracy: ${sectionAccuracy}%`, margin + 5, y);
      y += lineHeight;

      Object.entries(sectionScore.sectionWise).forEach(
        ([subSection, subSectionScore]) => {
          doc.setFontSize(12);
          doc.text(
            `  ${subSection}: ${subSectionScore.score}/${subSectionScore.maxScore}`,
            margin + 10,
            y
          );
          y += lineHeight;
        }
      );
      y += lineHeight / 2;
    });

    // Question-wise Details (placeholder, add your logic if needed)
    doc.setFontSize(14);
    // y = addQuestionWiseDetails(doc, questions, responses, y, margin, lineHeight);

    // Add Contact Details at the end
    y += lineHeight;
    doc.setFontSize(14);
    doc.text("Contact Details:", margin, y);
    y += lineHeight;
    doc.setFontSize(12);
    doc.text(`Email: ${userData.email}`, margin + 5, y);
    y += lineHeight;
    doc.text(`Phone: ${userData.phone}`, margin + 5, y);

    doc.save("jee_advanced_report.pdf");
  };

  return (
    <button
      onClick={generatePDF}
      className="mt-6 w-full flex items-center justify-center gap-2 bg-blue-500 text-white px-6 py-2 rounded-lg hover:bg-blue-600"
    >
      <Download className="w-5 h-5" />
      <span>Download Report (PDF)</span>
    </button>
  );
};
